import React from "react";

const cardClub = (props) => {
  const subjetsClub = props.map((item, index) => {
    return (
      <li key={index}>
        {" "}
        {item}
        <h2> {item.name}</h2>
      </li>
    );
  });
  return <ul>{subjetsClub}</ul>;
};

export default cardClub;
